import Link from 'next/link';

const Navbar = () => (
    <div>
        <nav className="main-navbar">
            <div>
                <p>IMDB</p>
            </div>
            <input className="search-input" type="text" placeholder="Search" />

            <div>
                <p>Sign in</p>
            </div>
        </nav>
    </div>


);

export default Navbar;
